export default function MainMenu(props){
	const displayMenu = (props)=>{
		const {menus} =props;
		if(menus.length>0){
			return(
				menus.map((menu,index)=>{
					console.log(menu);
					return(

					<>
					<p>{this.state.menu.id}jssssss</p>
					
					</>
					)
				})
			)
		}else{
			return(
				<p>Nothing to show</p>
				)
		}
	}
	return(
			<>
					{displayMenu(props)}
			</>
	)
}
